 We know that $(x + y)^2 = 105$ and $x^2 + y^2 = 65.$  We can use the formula $(x + y)^2 = x^2 + y^2 + 2xy$ to find $xy.$
$. [asy] unitsize (1 cm); 
real parab (real x) {
  return(x^2);
}
draw(graph(parab,-2.5,-2.5));
draw(graph(parab,2),red); 
draw((2.5,-1)--(2.5,1));
draw((-2.5,-1)--(-2.5,1));
draw((0,0)--(2,0),dashed);
draw((0,-1.5)--(0,1.5),dashed);
label("$x^2$", (2.5,-1));
label("$y^2$", (2.5,1));
label("$105 - 65$", (2.2,-0.8));
[/asy]
We subtract $x^2 + y^2 = 65$ from the equation $(x + y)^2 = 105 - 65 = 40$ to find $2xy = 40,$ so $xy = \boxed{20}.$
